import { Link } from "react-router-dom";
import React from "react";

function Book(props) {

    return (
        <Link to="/IndividualBook" state={{ ID: props.id }}>
            <div className="card book bg-light h-100" style={{ width: "15rem"}}>
                <img class="card-img-top" src={props.image} alt="NA" />
                <div class="card-body">
                    <h5 class="card-title bookName">{props.name}</h5>
                    <p class="card-text">{props.author}</p>
                </div>
            </div>
        </Link>
    );
}

